func rewriteBlockRISCV(b *Block, config *Config) bool {
	switch b.Kind {
	case BlockIf:
		// match: (If cond yes no)
		// cond:
		// result: (BNE cond yes no)
		for {
			v := b.Control
			_ = v
			cond := b.Control
			yes := b.Succs[0]
			no := b.Succs[1]
			b.Kind = BlockRISCVBNE
			b.SetControl(cond)
			_ = yes
			_ = no
			return true
		}
	}
	return false
}
